"106454":{"id":"106454","name":"Depois da Festa","slug":"depois-da-festa","original_title":"The Afterparty","overview":"Nada é o que parece ser neste hilário mistério de assassinato, onde a história de cada suspeito é contada através de um gênero de filme diferente.","first_air_date":"2022-01-28","episode_run_time":0,"vote_average":7.3,"number_of_seasons":2,"number_of_episodes":18,"created_by":["Christopher Miller"],"production_companies":["Lord Miller","TriStar Television","Sony Pictures Television"],"genres":["Mistério","Comédia","Crime"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/9ZyAUZrfccsjtDwYgc7yvOBnqM9.jpg","poster_path":"https://image.tmdb.org/t/p/original/ecjr5fu7DgtrN13t2CtaVOaO9EK.jpg","cast":["Tiffany Haddish","Sam Richardson","Zoë Chao","John Cho","Paul Walter Hauser"],"trailer":"iFLGuMH64iI","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/ecjr5fu7DgtrN13t2CtaVOaO9EK.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/ecjr5fu7DgtrN13t2CtaVOaO9EK.jpg","air_date":"2022-01-28","episode_count":8,"overview":"N/A","vote_average":7.3,"episodes":{"1":{"name":"Aniq","overview":"Após uma morte chocante na festa de reencontro do ensino médio, a detetive Danner interroga Aniq, que narra a noite como uma comédia romântica.","air_date":"2022-01-28","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/kUjYPhGqctjjp4oXtPeyBiXeLdq.jpg","vote_average":7.333},"2":{"name":"Brett","overview":"Na releitura cheia de ação de Brett, ele tinha um objetivo em participar da reunião: reconciliar-se com sua ex-mulher para unir sua família novamente.","air_date":"2022-01-28","runtime":34,"still_path":"https://image.tmdb.org/t/p/original/jM3prUos9smTUH0zZQ20XsfwSEt.jpg","vote_average":7.833},"3":{"name":"Yasper","overview":"Yasper explica como ele tentou fazer Xavier ajudá-lo a fazer sua carreira musical decolar. Sua versão dos eventos é um musical de levantar da cadeira.","air_date":"2022-01-28","runtime":34,"still_path":"https://image.tmdb.org/t/p/original/m6YJQJMuG8a6UoBhFFmLh59BW0L.jpg","vote_average":6.875},"4":{"name":"Chelsea","overview":"Chelsea revela seu motivo não tão inocente: vingança, pura e simplesmente. Sua recontagem é um tenso thriller psicológico.","air_date":"2022-02-04","runtime":33,"still_path":"https://image.tmdb.org/t/p/original/xVwWJF1RClyBp74cDkXKYNHu6Bg.jpg","vote_average":7},"5":{"name":"Ensino médio","overview":"As histórias de todos levam a uma festa do ensino médio de 15 anos atrás, que Walt conta para a detetive Danner — revelando enormes segredos.","air_date":"2022-02-11","runtime":36,"still_path":"https://image.tmdb.org/t/p/original/k8tPs8DpqLyC04czW9L9C53urYw.jpg","vote_average":7},"6":{"name":"Zoë","overview":"Zoë confessa que foi à reunião para uma noite selvagem, folga da sua vida de divorciada e mãe solteira. As coisas ficam animadas em sua releitura.","air_date":"2022-02-18","runtime":31,"still_path":"https://image.tmdb.org/t/p/original/dQiAEJIXcsBF5p1L3dF7uI52uXF.jpg","vote_average":7},"7":{"name":"Danner","overview":"Enquanto seus métodos não convencionais a colocam em encrenca, a detetive Danner olha para seu próprio passado para explicar por que ela precisa resolver este caso.","air_date":"2022-02-25","runtime":33,"still_path":"https://image.tmdb.org/t/p/original/1KDese24hl5YVBAEpzBSbUCuBAK.jpg","vote_average":7.5},"8":{"name":"Maggie","overview":"Uma testemunha inesperada surge para ajudar a Detetive Danner a juntar as peças da verdadeira história por trás da morte de Xavier.","air_date":"2022-03-04","runtime":35,"still_path":"https://image.tmdb.org/t/p/original/mzPEK3W2KABWSTzSWsh9rgH0vU1.jpg","vote_average":7.7}}},"2":{"name":"Temporada 2","poster_path":"https://image.tmdb.org/t/p/original/nIRXAaNWziptiF07U1I3yHDvbg2.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/nIRXAaNWziptiF07U1I3yHDvbg2.jpg","air_date":"2023-07-11","episode_count":10,"overview":"N/A","vote_average":6.7,"episodes":{"1":{"name":"Aniq 2: A continuação","overview":"Quando o fim de semana de casamento da irmã de Zoë é destruído por um assassinato, Aniq chama sua velha amiga Danner para investigar o crime.","air_date":"2023-07-11","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/f2h1K0G7IkREydO9z6d1FTjijtH.jpg","vote_average":6.857},"2":{"name":"Grace","overview":"Aniq e Danner escutam o depoimento da noiva, que conta a história de seu relacionamento com Edgar no estilo de um romance de Jane Austen.","air_date":"2023-07-11","runtime":37,"still_path":"https://image.tmdb.org/t/p/original/66EWkqvXXO80vnjomuPlTbLSUTk.jpg","vote_average":6.857},"3":{"name":"Travis","overview":"O ex-namorado de Grace conta sua história como um filme noir: ele suspeitava que Edgar não era bom e estava determinado a proteger sua ex.","air_date":"2023-07-18","runtime":34,"still_path":"https://image.tmdb.org/t/p/original/3XRkWMS0ib6AGNrqkNqfCLcvEoQ.jpg","vote_average":6.6},"4":{"name":"Hannah","overview":"Como a heroína de um filme indie, a irmã adotiva de Edgar queria impedir o casamento por causa de seu próprio coração partido.","air_date":"2023-07-25","runtime":31,"still_path":"https://image.tmdb.org/t/p/original/x8VHQADKsMuhn84cmoiiJWvCMr4.jpg","vote_average":6.167},"5":{"name":"Sebastian","overview":"Quando o sócio de Edgar se abre sobre sua história complicada, ela se mostra como um filme de assalto cheio de suspense.","air_date":"2023-08-01","runtime":34,"still_path":"https://image.tmdb.org/t/p/original/w92pFDB22tHMiYAJl672i0rUKss.jpg","vote_average":5.6},"6":{"name":"O fogo da Danner","overview":"Por que Danner realmente deixou a polícia? Ela apresenta a história cintilante para Aniq como um thriller quente dos anos 90.","air_date":"2023-08-08","runtime":34,"still_path":"https://image.tmdb.org/t/p/original/rKCZVyD3RDGuCl9NfMt7K9hwCdd.jpg","vote_average":7},"7":{"name":"Ulysses","overview":"Aniq e Danner levam a investigação para a família de Zoë, começando com seu tio aventureiro. Sua história é um romance épico e global.","air_date":"2023-08-15","runtime":38,"still_path":"https://image.tmdb.org/t/p/original/hzT2o0vGR3kdxHMtk4UUG1CPYIC.jpg","vote_average":6.8},"8":{"name":"Feng","overview":"O pai de Zoë relutantemente concorda em sentar-se com ela, Aniq e Danner enquanto eles assistem vídeos no estilo found-footage do fim de semana.","air_date":"2023-08-22","runtime":34,"still_path":"https://image.tmdb.org/t/p/original/fap2KQOB6qDfIPQzwUiSYeRGLEw.jpg","vote_average":7},"9":{"name":"Isabel","overview":"Lançando-se em um melodrama psicológico dos anos 50, a mãe de Edgar detalha seu ano terrível desde a morte de seu marido.","air_date":"2023-08-29","runtime":35,"still_path":"https://image.tmdb.org/t/p/original/zjjZIEqFeysP4VHgKVUXCi05zlP.jpg","vote_average":7.2},"10":{"name":"Vivian e Zoë","overview":"Alternando entre o terror exagerado e uma novela dos anos 80, Zoë e sua mãe preenchem as lacunas restantes do assassinato de Edgar.","air_date":"2023-09-05","runtime":31,"still_path":"https://image.tmdb.org/t/p/original/9Qg4RJmvu8bZvqqGnaYT2p4uvnw.jpg","vote_average":7.2}}}}},
