"235891":{"id":"235891","name":"The Greatest Show Never Made","slug":"the-greatest-show-never-made","original_title":"The Greatest Show Never Made","overview":"N/A","first_air_date":"2023-10-10","episode_run_time":60,"vote_average":4.5,"number_of_seasons":1,"number_of_episodes":3,"created_by":[],"production_companies":["Safe Harbour Films","Factual Fiction","B Good Picture Company"],"genres":["Documentário"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/6zfoFTnXO6IfCGhGFIsOl7SSEor.jpg","poster_path":"https://image.tmdb.org/t/p/original/x1EKtsOnMoWuEM6YI9iJnmp1TB7.jpg","cast":[],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/V6hlWBlBP3OGWNwrMpYae8DP7R.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/V6hlWBlBP3OGWNwrMpYae8DP7R.jpg","air_date":"2023-10-10","episode_count":3,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Episódio 1","overview":"JUNHO DE 2002. Lucie, Jane, Tim, Daniel, Rosy e John sonham com a fuga. Um anúncio de um programa de televisão oferece uma saída: “Procuram-se concorrentes. Um ano, 100 mil libras.” Mal podem acreditar, mas são selecionados. Deixam empregos, terminam relacionamentos, abandonam as suas casas e preparam-se para a aventura. Mas, poucas horas após chegarem a Londres, os seus sonhos começam a ruir.","air_date":"2023-10-10","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/Avs5hjm4u3olKgxFLVlHFiNOPoO.jpg","vote_average":0},"2":{"name":"Episódio 2","overview":"Aturdidos pela notícia de que não têm casa e de que têm de gerar o dinheiro do prémio, os concorrentes tentam desenrascar-se. O operador de câmara Tim filma a agitação quando descobrem a verdade por trás da fachada enigmática de Nik Russian. Quem é ele? Será que ainda os pode pôr na televisão? E, 20 anos depois, onde está ele?","air_date":"2023-10-10","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/bWTnN3MxIbn1D78g54Q61FlTkWY.jpg","vote_average":0},"3":{"name":"Episódio 3","overview":"No verão de 2002, o sonho de trinta pessoas de participarem num reality show tornou-se um pesadelo. Deram por si sem dinheiro, com fome e humilhados. Como pôde acontecer? E porquê? Durante 20 anos, as suas perguntas permaneceram sem resposta. Agora, uma detetive privada localizou o homem misterioso e carismático por detrás de tudo isso. É hora de Nikita Russian contar a sua história.","air_date":"2023-10-10","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/uJoGRhek60c69lB8VGSmJkc3YkL.jpg","vote_average":0}}}}},
