"222807":{"id":"222807","name":"O Desaparecimento de Kimmy Diore","slug":"o-desaparecimento-de-kimmy-diore","original_title":"Les Enfants sont rois","overview":"Quando Kimmy Diore é sequestrada, o choque vai além do círculo familiar. Kimmy não é uma menina de seis anos qualquer, mas sim uma estrela do YouTube que produz vídeos assistidos por milhões de pessoas. Para salvá-la, Sara Roussel mergulha em um mundo nada familiar que é fascinante e assustador. Ela entra no círculo da família Diore e descobre segredos que a fazem se lembrar do próprio passado.","first_air_date":"2024-10-23","episode_run_time":0,"vote_average":6.8,"number_of_seasons":1,"number_of_episodes":6,"created_by":["Victor Rodenbach","Judith Havas"],"production_companies":["Habanita Federation"],"genres":["Drama"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/uMjHSU8uZqwgaqwDSLOOdaowtHs.jpg","poster_path":"https://image.tmdb.org/t/p/original/vqq3pZPWpi3udHcDRuNv2Nxu6PS.jpg","cast":["Géraldine Nakache","Doria Tillier","India Hair","Oussama Kheddam","Panayotis Pascot"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/vqq3pZPWpi3udHcDRuNv2Nxu6PS.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/vqq3pZPWpi3udHcDRuNv2Nxu6PS.jpg","air_date":"2024-10-23","episode_count":6,"overview":"N/A","vote_average":10,"episodes":{"1":{"name":"O Desaparecimento","overview":"Mélanie Diore transformou a filha de seis anos em uma estrela da internet, graças ao canal \"Happy Recré\" e aos milhões de inscritos. Quando a menina é sequestrada, Sara Roussel é designada como responsável pela investigação. Ela mergulha num mundo desconhecido e descobre que a família tem muito a esconder.","air_date":"2024-10-23","runtime":40,"still_path":"https://image.tmdb.org/t/p/original/lFNbD2boLdzI0EeP9zrCa7wfhIi.jpg","vote_average":10},"2":{"name":"O Cavaleiro","overview":"Depois de receber uma mensagem do sequestrador com uma gravação da voz da Kimmy, Mélanie divulga o sequestro da filha ao público. No meio do alvoroço da imprensa, a polícia continua a investigação. Embora a família Diore tenha milhões de fãs, eles também têm alguns haters, e o sequestrador pode ser um deles.","air_date":"2024-10-23","runtime":35,"still_path":"https://image.tmdb.org/t/p/original/yZJejF2f6WerFwS6kquuEec4AhH.jpg","vote_average":0},"3":{"name":"Mães e Filhas","overview":"A investigação continua. Será que o sequestrador é David Bouthier, um ex-astro de reality shows que teve um passado misterioso com Mélanie Diore? Ou Valentin Lavalle, o misógino que foi solto pela polícia? Conforme a pressão da imprensa se instala sobre a família Diore, a chegada da mãe de Mélanie, Isabelle, coloca lenha na fogueira. Quando Bruno se afasta, Mélanie pede ajuda à Sara. As duas ficam mais próximas.","air_date":"2024-10-23","runtime":35,"still_path":"https://image.tmdb.org/t/p/original/mXIwXub5TYKPooAgMIKefo4qiuM.jpg","vote_average":0},"4":{"name":"Deslize","overview":"Bruno é preso após as declarações de David Bouthier. Mélanie se convence da culpa do rival Fabrice Perrot, que está lucrando com o desaparecimento da Kimmy. Sara segue essa pista enquanto Malik explora a possibilidade de ser um pedófilo. O tempo está passando, a polícia fica perdida, e Sara perde o controle. Em casa, Bruno encontra um cartão SD com um conteúdo assustador no quarto do Sammy.","air_date":"2024-10-23","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/62sKmbVFdwZV0pmJ2FqAEqJnfjx.jpg","vote_average":0},"5":{"name":"Cartão de Memória","overview":"Sara acorda na delegacia e encontra Bruno e Sammy, que foram entregar o cartão SD a ela. Sara se recusa a acreditar no que vê. Por causa do deslize do dia anterior, Mélanie reclama para Salomé, que retira Sara do caso. Mesmo assim, Sara vasculha o passado de Mélanie e descobre algo que a coloca na direção do sequestrador da Kimmy.","air_date":"2024-10-23","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/coz5B1SMdn14C45dehfVzDMutLz.jpg","vote_average":0},"6":{"name":"Zona Morta","overview":"Baptiste e Sara encontram o bichinho de pelúcia da Kimmy e não têm mais dúvidas sobre a identidade do sequestrador. Enquanto Baptiste alerta o resto do grupo, Sara vai sozinha a Ardenas para procurar Kimmy. Lá, a polícia local organiza um grupo de busca. Sob custódia, Mélanie fica impaciente.","air_date":"2024-10-23","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/sxkb8V5jHAJ5fuocCvVN1nyKupN.jpg","vote_average":0}}}}},
